  input: TEXT,F3XA,,"In response to your letter, the Committee wants to clarify the
    best efforts procedure. The Committee includes a clear and conspicuous request
    for the information with each solicitation along with an explaination of the law.  If
    the contributor does not provide the information, a letter is sent within 30 days
    explaining the law and asking for the information again.  A pre-stamped, pre-addressed
    envelope is provided.  No solicitation is included.  If the contributor provides
    the information, it is innclued in the Committee's next report or on an amended
    version of the original report.  In response to your inquiry of administrative
    expenses, the committee is very small and uses outside consultants and vendors
    to preform many functions.  There is a paid staff but the committee has no office
    space of its own.  Schedule B has been amended to include complete addresses for
    all vendors.  Following up on our previous conversations, the Committee has had
    system problems and we are still reveiwing all reports.  Additional information
    may be provided to clarify the public record in the coming weeks.  Please contact
    me if you have any questions.  Thank you."
